import { Component } from "react";

class State extends Component{
    constructor(props){
        super(props);
        this.state={
            id:1,
            name:"pavani",
        }
    }
    render(){
        return(
            <div>
             <p>
                Id:{this.state.id}<br/>
                Name:{this.state.name}
             </p>
            </div>
        )
    }
}
export default State;
